    movieId: string,
    text: string
}


const ReviewForm = ({movieId} : Props) => {
    return (
        <div className="form-container">
            <input
             type="text"
             placeholder='Digite sua avaliação'
             />
            <ButtonIcon text='SALVAR AVALIAÇÃO'/>
        </div>
    )
}

export default ReviewForm;
